control.onControlLoad:
//鼠标点击行激活处理
g5.linkChatId = null;
g5.tableClick = function(sender) {
    var c, x, y;
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 7; x++) {
            c = ee.getTableCell(ee.getControl("tablebody2"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    for (x = 0; x < 7; x++) {
        c = ee.getTableCell(ee.getControl("tablebody2"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset1)) {
        g5.linkChatId = null;
        return;
    }
    g5.linkChatId = parseInt(g5.dataset1.getData(0, sender.rowIndex));
    g5.linkChatUserName = g5.dataset1.getData(5, sender.rowIndex);
    g5.linkChat = g5.dataset1.getData(6, sender.rowIndex);
}


//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}

query();

control.onClick:
if (eb.isEmpty(g5.linkChatId) || isNaN(g5.linkChatId)) {
    alert("请选择有效的记录进行编辑");
    return;
}
g5.newlinkChatUserName = prompt("请输入新的消费者名字：", g5.linkChatUserName);
if (g5.newlinkChatUserName == null) return;
if (g5.newlinkChatUserName == g5.linkChatUserName) return;
modifyName();

if (eb.isEmpty(g5.linkChatId) || isNaN(g5.linkChatId)) {
    alert("请选择有效的记录进行操作");
    return;
}
if (!confirm("删除操作将导致不可返回的后果，如需恢复数据只有联系网管，您是否继续这个危险的操作？")) {
    return;
}
del();

if (eb.isEmpty(g5.linkChatId) || isNaN(g5.linkChatId)) {
    alert("请选择有效的记录进行编辑");
    return;
}
g5.newLinkChat = prompt("请输入新的消费者评论：", g5.linkChat);
if (g5.newLinkChat == null) return;
if (g5.newLinkChat == g5.linkChat) return;
modifyChat();

if (eb.isEmpty(g5.linkChatId) || isNaN(g5.linkChatId)) {
    alert("请选择有效的记录进行操作");
    return;
}
sortUp();

if (eb.isEmpty(g5.linkChatId) || isNaN(g5.linkChatId)) {
    alert("请选择有效的记录进行操作");
    return;
}
sortDown();

control.onUpdate:
if (text == "IDL") {
    ee.setText(sender, "<font color = '#d03030'>销售</font>");
} else if (text == "OFL") {
    ee.setText(sender, "<font color = '#30a030'>下架</font>");
} else if (text == "DEL") {
    ee.setText(sender, "删除");
} else {
    ee.setText(sender, text);
}

taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        "(linkChat.userName like '%" + db.encode(searchText) + "%') or " +
        "(linkChat.userChat like '%" + db.encode(searchText) + "%')) ";
}

sql =
    "SELECT count(*) as c " +
    "FROM dbo.linkChat INNER JOIN " +
    "      dbo.link ON dbo.linkChat.linkId = dbo.link.id INNER JOIN " +
    "      dbo.product ON dbo.link.productId = dbo.product.id " +
    "WHERE (dbo.product.companyId = " + companyId + ") and (dbo.linkChat.status = 'CHT') " + condition;
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT dbo.linkChat.id, dbo.linkChat.regDatetime, dbo.linkChat.linkId, dbo.link.name, " + 
    "      dbo.linkChat.sortValue, dbo.linkChat.userName, dbo.linkChat.userChat " +
    "FROM dbo.linkChat INNER JOIN " +
    "      dbo.link ON dbo.linkChat.linkId = dbo.link.id INNER JOIN " +
    "      dbo.product ON dbo.link.productId = dbo.product.id " +
    "WHERE (dbo.product.companyId = " + companyId + ") and (dbo.linkChat.status = 'CHT') " + condition +
    "ORDER BY dbo.linkChat.linkId DESC, dbo.linkChat.sortValue ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"id,regDatetime,linkId,name,sortValue,userName,userChat", pageSize*(pageCurrent-1), pageSize);

taskSetItem.script3:
if (eio.readString8() != "T") {
    alert("无法获取您需要的数据：" + eio.readString8());
